import logo from './logo.svg';
import './App.css';
import {Basic} from './components/top';

const hr={
  marginTop:"45px"
}
function App() {
  return (
    <div>
      <hr style={hr}></hr>
      <div className="App">      
        <Basic />
      </div>
    </div>
  );
}

export default App;
